import React from "react";
import { makeStyles } from '@material-ui/core/styles';
import Avatar from '@material-ui/core/Avatar';
import { deepOrange, deepPurple } from '@material-ui/core/colors';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Divider from '@material-ui/core/Divider';




class Profile extends React.Component {
    constructor() {
        super();
        this.state = {
            loggedIn: true
        }
    }

    render() {

        function loggedIn() {
            if (this.state.loggedIn !== true) {
                return <div className="profile-login-avatar">Sign In/Log In</div>
            } else {
                return <div className="profile-avatar"><Avatar>H</Avatar></div>
            }
        }
        return (
            <div className="profile">
                <div className="profile-top-page">{loggedIn}</div>
                <div className="settings-bar"><span className="settings-title">Display</span></div>
                <div className="settings-bar"><span className="settings-title">Privacy</span></div>
                <div className="settings-bar"><span className="settings-title">Notifications</span></div>
            </div>
        )
    }
}

//Sign in/login
//Avatar
//Username
//settings -- dark mode
//Notification
// 

export default Profile;
